import React, { useState } from 'react'
import ReactMarkdown from 'react-markdown'

import { Audio } from '../components'

import '../css/user-studies.css'

function Welcome_Page() {
  <ReactMarkdown source={`# **Welcome!**\nWe would like to invite you to be 
    part of this research project. Please read the following information 
    carefully before you decide to take part. This will tell you why the 
    research is being done and what you will be asked to do if you take part. 
    Please ask if there is anything that is not clear or if you would like 
    more information.`}/>
}

function Question_Pages(index, setIndex) {
  switch (index) {
    case 0:
      Welcome_Page();
      break;
  }
}

export default function Qualification() {

  const [index, setIndex] = useState(0);

  return (
    <div className='section'>
      <ReactMarkdown source={'Please listen to the following audio.'}/>
      <Audio name={'test-abx'} file={'sitting.mp3'}/>
    </div>
  );
}
